import { IOverpayment } from "../overpayment-tab/overpayment-tab.model";

export interface IRefundHistory {
    id?: string;
    transactionId?: string;
    overpaymentId?: string;
    refundType?: string;
    paydayDate?: string;
    payee?: string;
    payeePayDate?: string;
    refundPrincipalAmt?: string;
    refundInterestAmt?: string;
    refundActualAmt?: string;
    refundExcessAmt?: string;
    createdBy?: string;
    invalidatedBy?: string;
    refundStatus?: string;
}

export interface IOverpaymentRefund {
    id?: string;
    transactionId?: string;
    refundType?: string;
    date?: string;
    payee?: string;
    paydayDate?: string;
    refundActualAmt?: number;
    refundPrincipalAmt?: number;
    refundInterestAmt?: number;
    refundExcessAmt?: number;
    refundStatus?: RefundStatus;
    overpayments? : IOverpayment[];
    requestedBy?: string;
    requestedDt?: string;
    requestReviewedBy?: string;
    requestReviewedDt?: string;
    invalidationRequestedBy?: string;
    invalidationRequestedDt?: string;
    invalidationReviewedBy?: string;
    invalidationReviewedDt?: string;
    reason?: string;
}

export enum RefundStatus {
    PAP = "Pending Approval",
    APP = "Approved",
    PIN = "Pending Approval (Invalidate)",
    INV = "Invalidated",
    REJ = "Rejected",
    SUC = "Success"
}

export enum RefundType {
    CHEQUE = "CHEQUE",
    CASHIER = "CASHIER",
    MIPS = "MIPS",
    AXS = "AXS",
    WRITE_OFF = "WRITE-OFF",
    WAIVER = "WAIVER",
    NETS = "NETS",
    SYSTEM_OFFSET = "SYSTEM OFFSET"
}

export interface IOverpaymentPay {
    refundId?: string;
    overpaymentId?: string;
    principalAmt?: number;
    interestAmt?: number;
    overpayment?: IOverpayment;
    overpaymentRefund?: IOverpaymentRefund;
}
